import React, { Component } from "react";

class Bestselling extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <p>You earned ${this.props.totalRev} so far</p>
        <p>Your biggest order was {this.props.revMax}</p>
      </div>
    );
  }
}

export default Bestselling;
